import React from "react";
import { Col, Row, Container } from "../components/Grid";
import Jumbotron from "../components/Jumbotron";
import pic1 from "./goglobal.png";

function Home() {
  return (
    <Container fluid>
      <Row>
        <Col size="md-12">

        <div>
              <hr></hr> <img src={pic1} alt="a man" />
           </div>
        </Col>
      </Row>
    </Container>
  );
}

export default Home;
